import React from "react";
import "./Navbar.css"

export default function Navbar(){
    return(
        <nav className='navbar'>
        <ul>
          <li>Home</li>
          <li>About Us</li>
          <li>Contact Us</li>
        </ul>
      </nav>
    )
}
